★ナイキのバッグ！<br>
<br>
●防水加工を施した素材を採用！<br>
●しっかり収納できるジッパー付き。<br>
●大荷物の中に入れてもスッキリと収納する事が可能な長方形のシルエット！<br>
●携帯用のハウルループが持ち運びに便利！<br>
●ジムやクラブ、遠征などの移動シーンで活躍します！<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元　株式会社ナイキジャパン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
