★アディダスのシューズバッグ！<br>
<br>
●前面にロゴ、サイドに3本ラインの入ったシンプルなデザイン！<br>
●ファスナーが大きく開閉できて、シューズの出し入れがしやすいです。<br>
●持ち手付きで手提げでき、移動時の持ち運びラクラク！<br>
●スポーツシーンやジムなどのトレーニング、合宿、遠征、旅行等に重宝します。<br>
<br>
■素材 ポリエステル<br>
