★ナイキのシューズケース！<br>
<br>
●単体でも使用でき、大きいバッグの中にも入れられるシューズバッグ！<br>
●耐久性の高い素材を使用。また両サイド上下には通気孔を配置し、バッグの通気性を高めます。<br>
●外側に取り付けた持ち手が持ち運びやすさを向上！<br>
●内部に小物を収納できるジッパーポケット付き。<br>
●スポーツシーンから旅行や出張など、幅広いシーンで活躍します！<br>
<br>
■素材 ポリエステル<br>
■企画製造販売元 株式会社ナイキジャパン<br>
